import React from 'react';
import classes from "./Tab.module.css";

const Tab = ({props}) => {
    return (
        <div>
            <div className={classes.item}>
                {props.title}
            </div>
            <div>
                {props.content}
            </div>
        </div>
    );
};

export default Tab;
